<p>这里我就不谈增加 CPU 核数，或提高 CPU 主频这种改变硬件的优化方法了，毕竟得加钱嘛。我会从程序的角度，来分析什么样的程序在 CPU 上执行得更快、效率更高。</p>
<blockquote>
